{"description":"Allowed Null Session","displayName":"Allowed Null Session","additionalData":{"assessedResourceType":"ServerVulnerability","type":"VirtualMachine","vendorReferences":[{"title":"NA","link":"NA"}],"publishedTime":"1999-01-01T08:00:00.0000000Z","patchable":false,"cvss":{"2.0":{"base":5}},"threat":"It is possible to log into the target host using a NULL session.<BR>
Windows NT has a feature allowing anonymous users to obtain domain user names and the share list. Windows NT ACL editor requires the Domain Controllers to return a list of account names.<P>

We check for "HKEY_LOCAL_MACHINE\SYSTEM\CurrentControlSet\Control\LSA  RestrictAnonymous" as well as "HKLM\SYSTEM\CurrentControlSet\Services\LanmanServer\Parameters RestrictNullSessAccess" = 0 as Microsoft has stated that "Remote access to the registry may still be possible after you follow the steps in this article if the RestrictNullSessAccess registry value has been created and is set to 0. This value allows remote access to the registry by using a null session. The value overrides other explicit restrictive settings."","cve":[{"title":"CVE-2002-1117","link":"http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2002-1117"},{"title":"CVE-2000-1200","link":"http://cve.mitre.org/cgi-bin/cvename.cgi?name=CVE-2000-1200"}]},"category":"Windows","status":{"severity":"Medium","code":"Unhealthy"},"timeGenerated":"2020-08-12T20:14:15.2430000Z","remediation":"To disable or restrict null session, please refer to <A HREF="https://support.microsoft.com/en-us/help/143474/restricting-information-available-to-anonymous-logon-users" TARGET="_blank">Microsoft Knowledge Base Article For restricting-information-available-to-anonymous-logon-users</A> or <A HREF="https://technet.microsoft.com/en-us/library/cc957461.aspx" TARGET="_blank">Microsoft TechNet : RestrictNullSessAccess</A> for further details.<P>","impact":"Unauthorized users can establish a null session and obtain sensitive information, such as usernames and/or the share list, which could be used in further attacks against the host.","id":"90044"}

